            "fqsen": "\\Yaf\\Config\\Ini",
            "name": "Ini",
            "summary": "\\Yaf\\Config\\Ini\u0020enables\u0020developers\u0020to\u0020store\u0020configuration\u0020data\u0020in\u0020a\u0020familiar\u0020INI\u0020format\u0020and\u0020read\u0020them\u0020in\u0020the\u0020application\u0020by\u0020using\u0020nested\u0020object\u0020property\u0020syntax.\u0020The\u0020INI\u0020format\u0020is\u0020specialized\u0020to\u0020provide\u0020both\u0020the\u0020ability\u0020to\u0020have\u0020a\u0020hierarchy\u0020of\u0020configuration\u0020data\u0020keys\u0020and\u0020inheritance\u0020between\u0020configuration\u0020data\u0020sections.\u0020Configuration\u0020data\u0020hierarchies\u0020are\u0020supported\u0020by\u0020separating\u0020the\u0020keys\u0020with\u0020the\u0020dot\u0020or\u0020period\u0020character\u0020\u0028\u0022.\u0022\u0029.\u0020A\u0020section\u0020may\u0020extend\u0020or\u0020inherit\u0020from\u0020another\u0020section\u0020by\u0020following\u0020the\u0020section\u0020name\u0020with\u0020a\u0020colon\u0020character\u0020\u0028\u0022\u003A\u0022\u0029\u0020and\u0020the\u0020name\u0020of\u0020the\u0020section\u0020from\u0020which\u0020data\u0020are\u0020to\u0020be\u0020inherited.\u003Cbr\/\u003E\n\u0020Note\u003A\n\u0020\\Yaf\\Config\\Ini\u0020utilizes\u0020the\u0020\u00BB\u0020parse_ini_file\u0028\u0029\u0020PHP\u0020function.\u0020Please\u0020review\u0020this\u0020documentation\u0020to\u0020be\u0020aware\u0020of\u0020its\u0020specific\u0020behaviors,\u0020which\u0020propagate\u0020to\u0020\\Yaf\\Config\\Ini,\u0020such\u0020as\u0020how\u0020the\u0020special\u0020values\u0020of\u0020\u0022TRUE\u0022,\u0020\u0022FALSE\u0022,\u0020\u0022yes\u0022,\u0020\u0022no\u0022,\u0020and\u0020\u0022NULL\u0022\u0020are\u0020handled.",
